  "amen",
  "amen,vérité, ferme.   métaphorique fidèle.   véritablement, amen.   au début d'un discours - sûrement, vraiment, en vérité  à la fin - ainsi soit-il, que ceci s'accomplisse.     c'était une coutume, passée des synagogues aux assemblées chrétiennes, que lorsque quelqu'un avait lu ou parlé, ou avait offert une prière solennelle, les autres répondent Amen, montrant ainsi qu'ils s'associaient à ce qui avait été dit. Le mot \"amen\" est un mot remarquable, passé directement de l'Hébreu au Grec du Nouveau Testament, puis au Latin, à l'Anglais, au Français et de nombreuses autres langues, ce qui en fait pratiquement un mot universel. Il a été appelé le mot le plus connu des paroles humaines.Le mot est directement relié, en fait presque identique, au mot Hébreu qui veut dire \"croire\" (amam), ou fidèle.Ainsi, il prit le sens de \"sûr\" ou \"vraiment\", expression de confiance absolue",
