  "propos, discours, langage logique, parler, parole, mot, rendre compte, question, bruit, chose (dite), enseignement, renommée, s'entretenir, adresser, déclaration, un livre, roposition, affaire, motif, exhortation, se plaindre, prédication, langage, .., parole.   parole, émise de vive voix, implique conception ou idée.  ce que quelqu'un a dit.   une parole.  les dires de Dieu.  décret, mandat ou ordre.  préceptes moraux donnés par Dieu.  prophéties de l'Ancien Testament données par les prophètes   ce qui est déclaré, une pensée, déclaration, un aphorisme, un dicton, une maxime.    discours.   l'action de parler, discourir.  faculté de parole, adresse et pratique dans la parole.  une sorte ou un style de discours.  une parole continue et suivie - instruction.   doctrine, enseignement.  toute chose rapportée en parole, narration, récit.  matière à discussion, chose dite, affaire, cause de dispute, case, motif à plaider.  la chose dite ou dont il est question, événement, action.   son usage en considération de l'ESPRIT seul.   raison, la faculté mentale de penser, méditer, raisonner, calculer.  prendre en compte, c'est à dire avoir égard, considérer.  décompter, faire le point.  réponse ou explication en référence à un jugement.  raison, cause, fond.   Dans Jean, le mot dénote la Parole essentielle de Dieu, Jésus-Christ, la sagesse et le pouvoir en union avec Dieu, son ministre dans la création et le gouvernement de l'univers, la cause de toute vie sur terre, physique et morale ;  Jésus qui est venu dans une nature humaine pour procurer le salut à l'humanité, le Messie, la seconde personne de la Divinité, qui brille éminemment par ses paroles et ses actions.   Un philosophe Grec Héraclite, a le premier utilisé le terme Logos vers 600 av. J.C pour désigner la raison divine ou le plan qui coordonne un univers changeant. Ce mot est bien approprié à l'exposé de Jean 1",
